import React from 'react';
import ReactDOM from 'react-dom/client';

function Header(){
    return(<h1>Шапка</h1>)
}
function Footer(){
    return(<h1>Подвал</h1>)
}
function App(){
    return(<div className='Main'>
        <Header />
        <Footer />
        </div>
    )
}
const app = ReactDOM.createRoot(document.getElementById('App'))

app.render(<App />)
